const palette = {
    charcoal1: "#3a3a3a",
    charcoal1Transparent: "rbga(58, 58, 58, 0.3)",
    charcoal2: "#dcdcdc",

    black1: "#000",

    white1: "#FFFFFF"
}

export default palette;
